description:
At the Rainbow is the first live album from the Dutch rock band Focus, released in 1973. The album was recorded at the Rainbow Theatre in London on 5 May 1973. A studio album was initially slated for release, but it was shelved due to disagreements within the band. (An album compiled from the tapes of these sessions was later released with the title Ship of Memories.) At the Rainbow was released instead.

